    databaseURL: "https://catch-of-the-day-5001a-default-rtdb.asia-southeast1.firebasedatabase.app",
});

const base = Rebase.createClass(firebaseApp.database('https://catch-of-the-day-5001a-default-rtdb.asia-southeast1.firebasedatabase.app/'))


export {firebaseApp}
